<?php

require_once __DIR__ . '/setup.php';


class TestArlimaImageManager extends PHPUnit_Framework_TestCase {

    private static $square_img_base64 = '';
    private static $rectangle_img_base64 = '';

    private $square_attach_id;

    public function __construct($name = NULL, array $data = array(), $dataName = '')
    {
        parent::__construct($name, $data, $dataName);
        $this->setBackupGlobals(false); // This is needed when unit testing wordpress
    }

    private static function createWPImage($base64, $name)
    {
        return Arlima_Plugin::saveImageAsAttachment($base64, $name);
    }

    function createSquareImage()
    {
        $this->square_attach_id = self::createWPImage(self::$square_img_base64, 'test-img.jpg');
    }

    function testCreateImage()
    {
        $this->createSquareImage();
        $this->assertTrue( is_numeric($this->square_attach_id) );

        list($file, $width, $height) = wp_get_attachment_image_src($this->square_attach_id, 'default');
        // We remove the number suffix added by wp when having several images with the same name
        $this->assertEquals(preg_replace('/[0-9]/', '', basename($file)), 'test-img.jpg');

        $this->assertEquals(400, $width);
        $this->assertEquals(400, $height);
    }

    function testCreateSmallerVersion()
    {
        $this->createSquareImage();

        $max_width = 200;
        $versionizer = new Arlima_ImageVersionManager($this->square_attach_id);
        list($new_version_file) = $versionizer->getVersionFile($max_width);
        list($width, $height) = getimagesize( WP_CONTENT_DIR .'/uploads/'. $new_version_file);
        $this->assertEquals($max_width, $width);
        $this->assertEquals($max_width, $height);
    }

    function testCreateVersionOutOfRectangleImage()
    {
        $rectangle_attach_id = self::createWPImage(self::$rectangle_img_base64, 'rectangle.jpg');
        list($file, $width, $height) = wp_get_attachment_image_src($rectangle_attach_id, 'default');
        $this->assertEquals(250, $width);
        $this->assertEquals(400, $height);

        $versionizer = new Arlima_ImageVersionManager($rectangle_attach_id);
        list($new_version_file) = $versionizer->getVersionFile(150);
        list($width, $height) = getimagesize( WP_CONTENT_DIR .'/uploads/'. $new_version_file);
        $this->assertEquals(150, $width);
        $this->assertEquals(240, $height);
    }

    function testCreateLargerVersion()
    {
        $this->createSquareImage();

        // Should not make the image larger than original size
        $max_width = 600;
        $versionizer = new Arlima_ImageVersionManager($this->square_attach_id);
        list($new_version_file) = $versionizer->getVersionFile($max_width);
        list($width, $height) = getimagesize( WP_CONTENT_DIR .'/uploads/'. $new_version_file);
        $this->assertEquals(400, $width);
        $this->assertEquals(400, $height);
    }

    function testRemoveManyFiles()
    {
        $this->createSquareImage();
        $versionizer = new Arlima_ImageVersionManager($this->square_attach_id);
        $versionizer->getVersionURL(200);
        $versionizer->getVersionURL(250);
        $versionizer->getVersionURL(350);

        $this->assertEquals(3, count($versionizer->getVersions()));

        Arlima_ImageVersionManager::removeVersions($this->square_attach_id);

        $this->assertEquals(0, count($versionizer->getVersions()));
    }
}